import axios from 'axios';
import DashboardPage from '../pages/dashboard/dashboard.page';

export default class AuthService {
  getUser(...params) {
    axios({
      method: 'post',
      url: 'http://localhost:4242/api/login',
      data: {
        email: params[0],
        password: params[1],
      },
    }).then(function (response) {
      const token = response.data.token;
      if(token != null){
          DashboardPage();
      }
      return token;
    });
  }
}
